import axios from "axios"
let res = '';
axios.get('http://127.0.0.1:8000/api/v1/Friends').then((resp)=>{
    res = resp.data
})
export function Other(){
    return(
    <>
        <div>
            {console.log(res)}
        </div>
    </>
    )
}
